import React, {Component} from 'react';
import {Card, Button} from 'react-bootstrap';
import vasoEyesDown from '../images/vaso-eyesDown.jpg'

class SignUp extends Component {
    render() {
        return (
            <div>
                <Card>
                    <Card.Body>
                    <Card.Text>
                            Get notified when new classes open
                    </Card.Text>
                            <Button>click</Button>
                    </Card.Body>
                    <Card.Img variant="top" src={vasoEyesDown} className="w-50" />
                    <Card.Img variant="top" src={vasoEyesDown} />
                </Card>
            </div>

        )
    }
}

export default SignUp;
